func GetJspCode(base64Tmp string,relapce map[string]string) string {
	lengthpadding:=strings.Count(base64Tmp,"=")
	if relapce!=nil{
		n := base64.StdEncoding.DecodedLen(len(base64Tmp))
		bytecode:=make([]byte,n-lengthpadding)
		base64.StdEncoding.Decode(bytecode,[]byte(base64Tmp))    //base64解码
		hexTmp:=hex.EncodeToString(bytecode)     //hex编码的数据模版
		for i,v:=range relapce{
			hexTmp=GetNewHex(hexTmp,i,v)
		}
		hexlenth:=hex.DecodedLen(len(hexTmp))
		hexbyte:=make([]byte,hexlenth)
		_,err:=hex.Decode(hexbyte,[]byte(hexTmp)) //hex解码
		if err!=nil{
			fmt.Printf("Jsp解析模版hex解码错误：%v",err)
		}
		base64Tmp=base64.StdEncoding.EncodeToString(hexbyte)   //在base编码
	}
	return base64Tmp
}

func GetNewHex(oldhex string,oldvar,newvar string) string {
	hexoldvar:=hex.EncodeToString([]byte(oldvar))	//要替换的数据进行hex编码
	oldvarindex:=strings.Index(oldhex,hexoldvar)   //查找要替换数据的索引
	if oldvarindex!=-1{
		hexnewvar:=hex.EncodeToString([]byte(newvar))   //替换的数据进行编码
		hexnewvarlenth:=strconv.FormatInt(int64(len(hexnewvar))/2,16)  //替换数据编码之后的长度
		for len(hexnewvarlenth)<4 {   //补充到四位16进制
			hexnewvarlenth="0"+hexnewvarlenth
		}
		newhex:=oldhex[:oldvarindex-4]+hexnewvarlenth+hexnewvar+oldhex[oldvarindex+len(hexoldvar):]
		return newhex
	}
	return oldhex

}